import axios from 'axios';
import { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { useStateValue } from '../state';
import { Patient } from '../types';

const PatientPage = () => {
  const { id } = useParams<{ id: string }>();
  const [state, dispatch] = useStateValue();
  useEffect(() => {
    const fetchPatient = async () => {
      if (!state.patients.id) {
        try {
          const { data: patient } = await axios.get<Patient>(
            `http://localhost:3001/api/patients/${id}`
          );
          dispatch({ type: 'ADD_PATIENT', payload: patient });
        } catch (e: unknown) {
          if (axios.isAxiosError(e)) {
            console.error('Unknown Axios error', e);
          } else {
            console.error('Unknown general error', e);
          }
        }
      }
    };
    fetchPatient();
  }, [dispatch]);

  const patient = Object.keys(state.patients).find(
    (id) => state.patients[id] === useParams().id
  );
  return <h1>{}</h1>;
};

export default PatientPage;
